import React from "react";
import { Container} from  "semantic-ui-react";
import "./style.css";


const Home = () => (
  <Container className="title">
   <h1 className="titleName">Charlotte Mountain</h1>
   <h3 className="titleJob">JUNIOR WEB DEVELOPER</h3>
  </Container>
);

export default Home;
